    n = len(s)

    # Check if all characters are the same
    if len(set(s)) == 1:
        return 1

    # Check rotation for each possible length
    for i in range(1, n+1):
        if n % i == 0:
            t = s[:i]
            if t * (n // i) == s:
                return n // i

    return n

