def find_Nth_Digit(numerator, denominator, n):
    result = ""

    if numerator >= denominator:
        integer_part = numerator // denominator
        numerator = numerator % denominator
        result += str(integer_part)
    else:
        result += "0."

    decimal_part = ""
    decimals_seen = {}

    while n > 0:
        if numerator in decimals_seen:
            recurring_cycle = decimal_part[decimals_seen[numerator]:]
            result += recurring_cycle[n-1]
            break

        decimals_seen[numerator] = len(decimal_part)
        numerator *= 10
        decimal_part += str(numerator // denominator)
        numerator %= denominator

        if n <= len(decimal_part):
            result += decimal_part[n-1]
            break

        if numerator == 0:
            result += "0"
            n = 0

    return int(result)

