    if n == 0:
        return None

    if n == 1:
        return arr[0]

    left = 0
    right = n - 1

    while left <= right:
        mid = left + (right - left) // 2

        if mid % 2 == 0:
            if mid + 1 < n and arr[mid] == arr[mid + 1]:
                left = mid + 2
            else:
                right = mid - 1
        else:
            if mid - 1 >= 0 and arr[mid] == arr[mid - 1]:
                left = mid + 1
            else:
                right = mid - 1

    return arr[left]

