def is_majority(arr, n, x):
    left = 0
    right = n - 1

    while left <= right:
        mid = left + (right - left) // 2

        if arr[mid] == x:
            if (mid == 0 or arr[mid - 1] != x) and (mid + n // 2 >= n or arr[mid + n // 2] != x):
                return True
            elif mid + n // 2 < n and arr[mid + n // 2] == x:
                left = mid + 1
            else:
                right = mid - 1
        elif arr[mid] < x:
            left = mid + 1
        else:
            right = mid - 1

    return False

