def find_Min(arr, low, high):
    # Single element array
    if low == high:
        return arr[low]

    # No rotation
    if arr[low] < arr[high]:
        return arr[low]

    # Binary search to find the minimum element
    while low <= high:
        mid = low + (high - low) // 2

        # Check if mid is the minimum element
        if arr[mid] < arr[mid - 1]:
            return arr[mid]

        # Update low and high based on the comparison with mid
        if arr[mid] >= arr[low]:
            low = mid + 1
        else:
            high = mid - 1

