def even_bit_set_number(n):
    # Convert the number to binary string
    bin_str = bin(n)[2:]

    # Pad the binary string with zeros if its length is odd
    if len(bin_str) % 2 != 0:
        bin_str = '0' + bin_str

    # Initialize an empty string to store the result
    result = ''

    # Iterate through the binary string and set all even bits to 1
    for i in range(0, len(bin_str), 2):
        result += '1' + bin_str[i+1]

    # Convert the result back to integer
    return int(result, 2)

