def find_demlo(s):
    # Initialize a dictionary to keep track of the count of each digit
    digit_count = {}

    # Count the occurrence of each digit in the input string
    for digit in s:
        if digit in digit_count:
            digit_count[digit] += 1
        else:
            digit_count[digit] = 1

    # Sort the unique digits in ascending order
    unique_digits = sorted(list(set(s)))

    # Generate the demlo number based on the counts of each digit
    demlo_number = ''
    for digit in unique_digits:
        count = digit_count[digit]
        demlo_number += ''.join(str(i) for i in range(1, count+1))

    # Add the descending part of the demlo number
    for digit in unique_digits[::-1]:
        count = digit_count[digit]
        demlo_number += ''.join(str(i) for i in range(count, 0, -1))

    return demlo_number

