def count_Odd_Squares(n, m):
    def is_odd(number):
        return number % 2 != 0

    def count_factors(number):
        count = 0
        for i in range(1, number + 1):
            if number % i == 0:
                count += 1
        return count

    odd_squares_count = 0
    for i in range(n, m+1):
        sqrt_i = int(i ** 0.5)
        if sqrt_i ** 2 == i:
            if is_odd(count_factors(i)):
                odd_squares_count += 1

    return odd_squares_count

