    low = 0
    high = len(A) - 1

    while low <= high:
        if A[low] <= A[high]:
            return low

        mid = (low + high) // 2
        next = (mid + 1) % len(A)
        prev = (mid - 1) % len(A)

        if A[mid] <= A[next] and A[mid] <= A[prev]:
