def ncr_modp(n, r, p):
    def power(x, y, p):
        res = 1
        x = x % p
        while y > 0:
            if y % 2 == 1:
                res = (res * x) % p
            y = y // 2
            x = (x * x) % p
        return res

    if r == 0:
        return 1

    fact = [1] * (n + 1)
    for i in range(2, n + 1):
        fact[i] = fact[i - 1] * i % p

    inv = [1] * (n + 1)
    inv[n] = power(fact[n], p - 2, p)
    for i in range(n - 1, 0, -1):
        inv[i] = inv[i + 1] * (i + 1) % p

    return (fact[n] * inv[r] % p * inv[n - r] % p) % p

