    dp = [[0 for _ in range(n)] for _ in range(m)]

    # Initialize the rightmost column with the values from the given gold matrix
    for i in range(m):
        dp[i][n-1] = gold[i][n-1]

    # Iterate over the matrix starting from the second rightmost column
    for j in range(n-2, -1, -1):
        for i in range(m):
            # Possible movement directions for gold miner
            directions = [0, -1, 1]
            max_gold = 0
            for direction in directions:
                new_i = i + direction
                if 0 <= new_i < m:
                    max_gold = max(max_gold, dp[new_i][j+1])
            dp[i][j] = gold[i][j] + max_gold

    # Find the maximum gold collected by iterating over the first column
