    # If there is only one element in the array
    if low == high:
        return arr[low]

    # If the array is not rotated
    if arr[low] < arr[high]:
        return arr[high]

    mid = (low + high) // 2

    # Check if the mid element is the maximum element
    if mid < high and arr[mid] > arr[mid + 1]:
        return arr[mid]
    if mid > low and arr[mid] < arr[mid - 1]:
        return arr[mid - 1]

