    # Check if the length of the two binary strings are equal
    if len(s1) != len(s2):
        return "Not Possible"

    # Count the number of differences between the two strings
    diff_count = 0
    for i in range(len(s1)):
        if s1[i] != s2[i]:
            diff_count += 1

    # If the number of differences is odd, it is not possible to convert s1 to s2 with swaps
