def maxAverageOfPath(cost, N):
    if N == 0:
        return 0

    dp = [[0 for _ in range(N + 1)] for _ in range(N)]

    # Fill the last column with the cost values
    for i in range(N):
        dp[i][N] = cost[i][N - 1]

    # Iterate from the second last column towards the first column
    for j in range(N - 1, 0, -1):
        for i in range(N):
            # Update the maximum average path till now
            dp[i][j] = max(dp[i - 1][j + 1] if i > 0 else 0, dp[i][j + 1], dp[i + 1][j + 1] if i < N - 1 else 0) + cost[i][j - 1]

    # Calculate the result by dividing the maximum sum by N
    max_avg = max([dp[i][1] for i in range(N)]) / N

    return max_avg

