def check_min_heap(arr, i):
    # Base case: If the current index i is beyond the array length, return True
    if i >= len(arr):
        return True

    left = 2*i + 1
    right = 2*i + 2

    # If left child exists and is smaller than root, return False
    if left < len(arr) and arr[left] < arr[i]:
        return False

    # If right child exists and is smaller than root, return False
    if right < len(arr) and arr[right] < arr[i]:
        return False

    # Recursively check left and right subtrees
    return check_min_heap(arr, left) and check_min_heap(arr, right)

