    # Check if the triangle is valid
    if a + b <= c or a + c <= b or b + c <= a:
        return "Not a triangle"

    # Calculate the squares of the sides
    a_sq = a**2
    b_sq = b**2
    c_sq = c**2

    # Check the type of triangle based on Pythagorean theorem
    if a_sq + b_sq < c_sq or a_sq + c_sq < b_sq or b_sq + c_sq < a_sq:
        return "Obtuse-angled Triangle"
    elif a_sq + b_sq == c_sq or a_sq + c_sq == b_sq or b_sq + c_sq == a_sq:
        return "Right-angled Triangle"
    elif a_sq + b_sq > c_sq and a_sq + c_sq > b_sq and b_sq + c_sq > a_sq:
        return "Acute-angled Triangle"

